import WidgetContainer from "components/WidgetContainer";
// import FlexBetween from "components/FlexBetween";
import React from "react";
import { Box } from "@mui/material";

const Advert = () => {
  return (
    <WidgetContainer>
      <Box>Sponsored</Box>
      <Box>
        <img src="" alt="advert" />
      </Box>
      <FlexBetween></FlexBetween>
    </WidgetContainer>
  );
};

export default Advert;
